import React from 'react';
import {NewChatLayout, AddButton, SvgButton} from '../../styles/buttons/NewChat.tw';

const NewChat = ({onClick}) => {
    return (
        <NewChatLayout type="text">
            New Conversation
            <AddButton onClick={onClick}>
                <SvgButton/>
            </AddButton>
        </NewChatLayout>
    );
}

export default NewChat;
